Amazon.com review
For four decades, Spanish guitarist Paco de Lucia's jazzy, Mephisto-like technique redefined flamenco. This CD, which means &quot;Good Small Things,&quot; is de Lucia's first release in five years, and it's been worth the wait. Most of the eight tracks feature just de Lucia, a chorus of vocalists, percussion, and the zesty handclaps called palmas. Lucia and company take you through the Moorish, Jewish, and Gypsy inventions and dimensions of flamenco... &lt;a href=&quot;
